/// Al nodemodule ERC721Upgradeable, heredarle AccessControl!! 
contract NFTSPORT is ERC721BurnableUpgradeable {

    uint public id = 1;
    string private _baseUri;

    struct tokenData{
        address creator;
        TicketType tipo;
    }

    enum TicketType {
    ENTRADA,CUPON
    }
    mapping (uint => tokenData) public tokenDatas;

    //EVENTS
    event NewNFT(address creator, uint id,TicketType tipo);
    event MintBatch(address _owner, uint amount, TicketType tipo);
    event BurnNFT( uint id);

    //MODIFIERS
    modifier onlyOwner(){
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), "Only owner can access");
        _;
    }


    function initialize() public initializer {
      _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
      __ERC721_init("NFTSPORT", "RUN");
        _baseUri = "ipfs://";

    }


    function getTokenData(uint256 tokenId) public view returns (tokenData memory){
        return tokenDatas[tokenId];
    }


    /**
     * @dev user creates new NFTs
     */
    function mintNew(address _owner, TicketType tipo) public onlyOwner returns (uint){
        _mint(_owner, id);

        tokenDatas[id] = tokenData({
            creator: _owner,
            tipo:tipo
        });
        emit NewNFT(_owner, id,tipo);
        id++;
        return(id-1);
    }

    /**
     * @dev user burns his NFTs
     */

     /// Hay que alterar esta funcion llamada _isApprovedOrOwner en ERC721Upgradeable.sol y ERC721BurnableUpgradeable y agregar esto al require "|| hasRole(DEFAULT_ADMIN_ROLE, msg.sender)" para permitir al owner transferir de un usuario a otro sin aprobacion
    function burnIt(uint tokenId) public onlyOwner{
        burn(tokenId);
        emit BurnNFT (tokenId);
    }
      function mintBatch(address _owner, uint amount,TicketType tipo) public onlyOwner {
        for (uint i=0; i<amount;i++)
    {
        _mint(_owner, id);

        tokenDatas[id] = tokenData({
            creator: _owner,
            tipo:tipo
        });
        id++;
    }      
        emit MintBatch(_owner, amount,tipo);
    }


